
--
-- Name: bots; Type: TABLE; Schema: public; Owner: postgres
--

CREATE TABLE public.bots (
    id uuid DEFAULT gen_random_uuid() NOT NULL,
    created_at timestamp with time zone DEFAULT now() NOT NULL,
    uid character varying,
    avatar character varying DEFAULT ''::character varying,
    description character varying DEFAULT ''::character varying,
    prompt text DEFAULT ''::text,
    files text[],
    enable_img_generation boolean DEFAULT false,
    label character varying,
    name character varying DEFAULT ''::character varying NOT NULL,
    starters text[],
    voice text,
    public boolean DEFAULT false,
    updated_at timestamp with time zone DEFAULT now()
);


ALTER TABLE public.bots OWNER TO postgres;

--
-- Name: TABLE bots; Type: COMMENT; Schema: public; Owner: postgres
--

COMMENT ON TABLE public.bots IS 'bots list';


--
-- Name: COLUMN bots.voice; Type: COMMENT; Schema: public; Owner: postgres
--

COMMENT ON COLUMN public.bots.voice IS 'Text to speech voice';


